public int hashCode() {
  final int prime = 31;
  int result = 1;
  result =
      prime * result + ((parentQueue == null) ? 0 : parentQueue.hashCode());
  result = prime * result + ((queue == null) ? 0 : queue.hashCode());
  result = prime * result + ((source == null) ? 0 : source.hashCode());
  result = prime * result + ((type == null) ? 0 : type.hashCode());
  return result;
}
